import React from 'react'
import Nav from './NavBar';
import '../styles/Home.css'
import vividwallpaper from "../images/vivid-wallpaper.jpg";

const Home = () => {
    return (
      <div className="home">
        <Nav />
        <img src={vividwallpaper} alt="" />
      </div>
    );
}

export default Home
